Scalar activationFun0(Scalar x)
{
    return x < 0 ? 0 : x;
}

Scalar activationDerivativeFun0(Scalar x)
{
    return x < 0 ? 0 : 1;
}

Scalar activationFun1(Scalar x)
{
    return tanhf(x);
}

Scalar activationDerivativeFun1(Scalar x)
{
    Scalar y = tanhf(x);
    return 1 - y * y;
}

Scalar activationFun2(Scalar x) 
{
    return x;
}

Scalar activationDerivativeFun2(Scalar x)
{
    return 1;
}
//ReLu
Scalar activationFun3(Scalar x)
{
    return x > 0 ? x : 0;
}

Scalar activationDerivativeFun3(Scalar x)
{
    return x > 0 ? 1 : 0;
}

//HadamardProduct to n cols C for 1 cols A and n cols B
Matrix HP1cNc(Matrix * A, Matrix * B)
{
    if (A->rows() != B->rows() || 
        A->cols() != 1) 
    {
        return Matrix();
    }
    Matrix C(B->rows(), B->cols());
    for (unsigned  i = 0; i < B->rows(); i++)
    {
        for (unsigned  j = 0; j < B->cols(); j++)
        {
            C(i,j) = (*A)(i,0) * (*B)(i,j);
        }
    }
    return C;
}

NeuralNetwork::NeuralNetwork()
{}

NeuralNetwork::NeuralNetwork(std::vector<unsigned> init_topology, 
                             Scalar init_lamda, 
                             unsigned init_batch_size)
{
    topology = init_topology;
    learningRate = init_lamda;
    batch_size = init_batch_size;
    for (unsigned i = 0; i < topology.size(); i++)
    {
        layers.push_back (new Matrix(topology[i], 1));
        gradients_H.push_back(new Matrix(topology[i], 1));
        if (i < topology.size() - 1)
        {
            weights.push_back(new Matrix(topology[i + 1], topology[i]));
            weights.back()->setConstant(1);
            gradients_W.push_back(new Matrix(topology[i + 1], topology[i]));
            gradients_W_batch.push_back(new Matrix(topology[i + 1], topology[i]));
            gradients_W_batch.back()->setConstant(0);

            biases.push_back(new Matrix(topology[i + 1], 1));
            biases.back()->setConstant(0);
            gradients_B.push_back(new Matrix(topology[i + 1], 1));
            gradients_B_batch.push_back(new Matrix(topology[i + 1], 1));
            gradients_B_batch.back()->setConstant(0);
        }
        if (i < topology.size() - 2)
        {
            dfs.push_back(new Matrix(topology[i + 1], 1));
        }
    }
}
NeuralNetwork::NeuralNetwork(std::vector<Matrix> & init_weights,  std::vector<Matrix> & init_biases,  std::vector<TAcFun> & init_activations)
{
    for (unsigned i = 0; i < weights.size(); i++)
    {
        topology.push_back(init_weights[i].size());
        weights.push_back( &init_weights[i]);
        biases.push_back( &init_biases[i]);
        activations.push_back(init_activations[i]);
    }
}



NeuralNetwork::~NeuralNetwork()
{
    for (unsigned i = 0; i < layers.size(); i++)
    {
        delete layers[i];
    }
    for (unsigned i = 0; i < dfs.size(); i++)
    {
        delete dfs[i];
    }
    for (unsigned i = 0; i < gradients_H.size(); i++)
    {
        delete gradients_H[i];
    }
    for (unsigned i = 0; i < weights.size(); i++)
    {
        delete weights[i];
    }
}


//cost = 1/(2k) * \sum(output_i - expected_i)^2 where i in [1,k]
Scalar NeuralNetwork::cost(Matrix & expected)
{
    Matrix tmp = ((*layers.back() - expected).transpose() * (*layers.back() - expected));
    return tmp(0,0) / 2 * expected.size();
}
void NeuralNetwork::cost_gradient(Matrix & derivatives, Matrix & expected) 
{
    derivatives = (*(layers.back()) - expected) / expected.size();
}

void NeuralNetwork::propagateForward(Matrix & input, int f_train)
{
    //input layers
    *layers[0] = input;
    //hidden layers
    if (f_train) //for training
    {
        for (unsigned i = 0; i < topology.size() - 1; i++) 
        {
            *layers[i + 1] = (*weights[i]) * (*layers[i]) + *biases[i]; //=z_i not activated yet
            if (i < topology.size() - 2)
            {
                *dfs[i] = (*layers[i + 1]).unaryExpr(TAcFun(activationDerivativeFun3));
                *layers[i + 1] = (*layers[i + 1]).unaryExpr(TAcFun(activationFun3));
            }
        }
    }
    else //only for computing output
    {
        for (unsigned i = 0; i < topology.size() - 1; i++) 
        {
            *layers[i + 1] = (*weights[i]) * (*layers[i]) + *biases[i]; //=z_i not activated yet
            if (i < topology.size() - 2)
            {
                *layers[i + 1] = (*layers[i + 1]).unaryExpr(TAcFun(activationFun3));
            }
        }
    }
    //output layers  
    //none
}

void NeuralNetwork::propagateBackward(Matrix & expected)
{
    cost_gradient(*gradients_H.back(), expected);
    //std::cout << "pb1 " << *gradients_H.back() << " layers " << *layers.back() << "\n";
    for (int i = topology.size() - 2; i >= 0; i--) 
    {
        //Compute gradients
        if (i == topology.size() - 2)
        {   
            //Since dfs for this layer is constantly 1. They're omitted.
            *gradients_H[i] = weights[i]->transpose() * *gradients_H[i + 1];
            *gradients_W[i] = *gradients_H[i + 1] * layers[i]->transpose();
            *gradients_B[i] = *gradients_H[i + 1];
        }
        else 
        {
            Matrix tmp = HP1cNc(dfs[i], weights[i]);
            *gradients_H[i] = tmp.transpose() * *gradients_H[i + 1]; 
            *gradients_B[i] = HP1cNc(gradients_H[i + 1], dfs[i]);
            *gradients_W[i] = *gradients_B[i] * layers[i]->transpose();

        }
        *gradients_W_batch[i] += *gradients_W[i];
        *gradients_B_batch[i] += *gradients_B[i];
        //Update weights
    }
}

void NeuralNetwork::updateWeights()
{
    for (int i = 0; i < weights.size(); i++)
    {
        //*gradients_W_batch[i] /= batch_size;
        *weights[i] -= learningRate * *gradients_W_batch[i];
        gradients_W_batch[i]->setConstant(0);

        //*gradients_B_batch[i] /= batch_size;
        *biases[i] -= learningRate * *gradients_B_batch[i];
        gradients_B_batch[i]->setConstant(0);
    }
}


void NeuralNetwork::train(std::vector<Matrix*> input_data, std::vector<Matrix*> output_data)
{
    for (unsigned i = 0; i < input_data.size(); i++) 
    {
        double t1 = clock();
        propagateForward(*input_data[i], 1); 
        double t2 = clock();
        propagateBackward(*output_data[i]);
        double t3 = clock();
        if (i % batch_size == batch_size - 1)
        {
            updateWeights();
        }
        double t4 = clock();
        double ts = t4-t1;
        //std::cout << "ts " << (t2-t1)/ts << " " << (t3-t2)/ts << " " << (t4-t3)/ts << "\n";
    }
}

Scalar MSE(NeuralNetwork & nn, std::vector<Matrix*> input_data, std::vector<Matrix*> output_data)
{
    Scalar mse = 0;
    for (unsigned i = 0; i < input_data.size(); i++) 
    {
        nn.propagateForward(*input_data[i], 0); 
        mse += nn.cost(*output_data[i]);
        std::cout << "mse " << *nn.layers.back() << " " << *output_data[i] << "\n";
    }
    mse /= input_data.size();
    return mse;
}

void ReadCSV(std::string filename, Data & data)
{
    data.clear();
    std::ifstream file(filename, std::ifstream::in);
    std::string line, word;
    // determine number of columns in file
    std::getline(file, line, '\n');
    std::stringstream ss(line);
    std::vector<Scalar> parsed_vec;
    while (std::getline(ss, word, ',')) {
        parsed_vec.push_back(Scalar(std::stof(&word[0])));
    }
    unsigned cols = parsed_vec.size();
    data.push_back(new Matrix(cols, 1));
    for (unsigned i = 0; i < cols; i++) {
        data.back()->coeffRef(i, 0) = parsed_vec[i];
    }

    // read the file
    if (file.is_open()) {
        while (std::getline(file, line, '\n')) {
            std::stringstream ss(line);
            data.push_back(new Matrix(cols, 1));
            unsigned i = 0;
            while (std::getline(ss, word, ',')) {
                data.back()->coeffRef(i, 0) = Scalar(std::stof(&word[0]));
                i++;
            }
        }
    }
}

void genData(std::string filename)
{
    std::ofstream file1(filename + "-in");
    std::ofstream file2(filename + "-out");
    Scalar max_value = 1;
    Scalar max_err = 1;
    for (unsigned r = 0; r < 10000; r++) 
    {
        Scalar x1 = max_value * rand() / Scalar(RAND_MAX);
        Scalar x2 = max_value * rand() / Scalar(RAND_MAX);
        Scalar x3 = max_value * rand() / Scalar(RAND_MAX);
        Scalar err =max_err   * rand() / Scalar(RAND_MAX);
        Scalar y1 = 2 * x1 + x2 * x2 * x1 + x3; //+ err;
        Scalar y2 = x1 + 2* x2*x1+x2*x3*x1 + x3*x3*x3; //+ err;
        file1 << x1 << ", " << x2 << ", " << x3 << "\n";
        file2 << y1 << "\n";
    }
    file1.close();
    file2.close();
}
