Matrix & Model2::getOutput(unsigned n)
{
    if (n == 0) 
    {
        return *nn10.layers.back();
    }
    else
    {
        return *nn11.layers.back();
    }
}

Matrix & Model2::forward(Matrix & input, int f_train) 
{
    nn00.propagateForward(input, f_train);
    nn10.propagateForward(*nn00.layers.back(), f_train);
    nn11.propagateForward(*nn00.layers.back(), f_train);
    return *nn11.layers.back();
}



